class Solution {

    /**
     * @param Integer[] $nums
     * @return Boolean
     */
    function hasTrailingZeros($nums) {
        // Iterate through all combinations of elements
        $n = count($nums);
        for ($i = 0; $i < (1 << $n); $i++) {
            $orResult = 0;
            for ($j = 0; $j < $n; $j++) {
                // If the j-th element is part of the combination
                if ($i & (1 << $j)) {
                    $orResult |= $nums[$j];
                }
            }
            // Check for trailing zeros only if we have selected at least two elements
            if ($orResult > 0 && ($i & ($i - 1)) && ($orResult & ($orResult + 1)) == 0) {
                return true;
            }
        }
        return false;
    }
}
